import React from 'react';
import PropTypes from 'prop-types';
import "antd/dist/antd.css"

const App = ({ Component }) => {
    return (
        <Component />
    )
};

// propTypes는 안정성을 높힌다, 점검
App.propTypes = {
    Component: PropTypes.elementType.isRequired,
}

export default App;
